import { BrowserRouter,Routes,Route, Link } from 'react-router-dom'; 
import logo from './logo.svg';
import './App.css';
import Gallery from './components/Gallery';
import VipApi from './components/VipApi';
import ShopPage from './pages/ShopPage';

function App() { 
  return(
<BrowserRouter>
<header className="bg-warning p-2"> 
<div className="container">
  <Link to="/" className="btn btn-outline-dark me-2">Home</Link>
  <Link to="/vip" className="btn btn-outline-dark">V.I.P</Link>
  <Link to="/shop" className="btn btn-outline-dark">Shop</Link>
  </div>
</header>
<Routes>
  <Route path="/" element={<Gallery />} />
  <Route path="/vip" element={<VipApi />} />
  <Route path="/shop/:category" element={<h1>ShopPage</h1>} />
</Routes>
 </BrowserRouter>
  );

}
export default App;
